import React, { Component } from "react";

class PlacePicker extends Component {
  render() {
    return (
      <div>
        <span>
          <h4>Point Of Interest</h4>
          <input type="test" placeholder="Leave Blank = no POI"></input>
        </span>
        <span>
          <h4>Radius</h4>
          <input
            type="range"
            min="0"
            max="1000"
            onChange={this.props.onSetRadius}
          ></input>
        </span>
      </div>
    );
  }
}

export default PlacePicker;
